import React from "react";
import { Link } from "react-router-dom"


function Header(){
    return(
    <header>
        <nav>
            <Link to="/home" class="navAnchor">Home</Link>
            <Link to="/jobs" class="navAnchor">Prior Jobs</Link>
            <Link to="/contacts" class="navAnchor">Contact Us</Link>
        </nav>
    </header>
    )
}

export default Header
